const userId = $('Dados').item.json.remoteJid;

const outputItems = [];

for (const item of inputItems) {
  const dados = item.json;

  let pontuacao = 0;

  const normalize = (value) => {
    if (!value) return '';
    return value.toString().trim().toLowerCase();
  };

  // 1. Plano de NegÃ³cios
  if (normalize(dados["Plano de negÃ³cios"]).includes("sim")) {
    pontuacao += 1;
  }

  // 2. TamSamSom
  if (normalize(dados["TamSamSom"]).includes("sim")) {
    pontuacao += 1;
  }

  // 3. Pesquisa Qualitativa
  const pesquisa = normalize(dados["Pesquisa qualitativa:"]);
  if (pesquisa.includes("dados organizados")) {
    pontuacao += 2;
  } else if (pesquisa.includes("informal")) {
    pontuacao += 1;
  }

  // 4. Concorrentes
  const concorrentes = normalize(dados["Mapeamento concorrentes"]);
  if (concorrentes.includes("dados organizados")) {
    pontuacao += 2;
  } else if (concorrentes.includes("informal")) {
    pontuacao += 1;
  }

  // 5. Persona
  if (normalize(dados["Persona"]).includes("sim")) {
    pontuacao += 1;
  }

  // 6. Pitch
  const pitch = normalize(dados["Pitch"]);
  if (pitch.includes("dados organizados") || pitch.includes("sim")) {
    pontuacao += 1;
  }

  // Determinar resultado com base na pontuaÃ§Ã£o
  let resultado = '';

  if (pontuacao === 8) {
    resultado = 'Aprovado para IncubaÃ§Ã£o';
  } else if (pontuacao >= 4 && pontuacao <= 7) {
    resultado = 'Trilha AvanÃ§ada';
  } else {
    resultado = 'Trilha Inicial';
  }

  // Montar objeto de saÃ­da
  outputItems.push({
    json: {
      ...dados,
      pontuacao,
      resultado,
      user_id: userId,
      data_qualificacao: new Date().toISOString()
    }
  });
}

return outputItems;

